// ==UserScript==
// @author         Jonas Thelemann
// @description    Adds a trollface or trolltext to some large websites.
// @description:de Fügt ein Trollface oder einen Trolltext auf einigen großen Websites ein.
// @grant          none
// @icon           data:image/png;base64,
// @include        *apple.com*
// @include        *bing.com*
// @include        *duckduckgo.com*
// @include        *google.de*
// @include        *netflix.com*
// @include        *wikipedia.org*
// @license        GPL version 3 or any later version; http://www.gnu.org/licenses/gpl.txt
// @name           Troll'em
// @name:de        Troll'em
// @namespace      https://greasyfork.org/users/4685
// @version        1.6
// ==/UserScript==
//Einfügen erlauben
var logo = null;
var sheet = (function () {
  // Create the <style> tag
  var style = document.createElement('style');
  // WebKit hack
  style.appendChild(document.createTextNode(''));
  // Add the <style> element to the page
  document.head.appendChild(style);
  return style.sheet;
}) ();
var hostname = window.location.hostname;
hostname = hostname.substring(0, hostname.lastIndexOf('.'));
hostname = hostname.substring(hostname.lastIndexOf('.') + 1, hostname.length);
switch (hostname) {
  case 'apple':
    logo = document.querySelector('#ac-gn-firstfocus');
    if (isset(logo)) {
      // Replace the apple logo with a trollface
      logo.parentNode.innerHTML = '<span style="display: inline-block;height: 100%;vertical-align: middle;"></span><img src="data:image/png;base64," height="30" width="30"></img>';
    }
    break;
  case 'bing':
    logo = document.querySelector('#b_logo');
    if (isset(logo)) {
      // Replace "Bing" with "Troll" next to search bar
      logo.firstChild.remove()
      logo.parentNode.innerHTML = logo.parentNode.innerHTML + '<span style="font-size: xxx-large;color: white;left: 60px;position: absolute;bottom: -5px;">Troll</span>'
    }
    break;
  case 'duckduckgo':
    logo = document.querySelector('#logo_homepage_link');
    if (isset(logo)) {
      // Replace logo's duck with a trollface
      logo.style.backgroundImage = 'url(\'data:image/png;base64,\')'
    }
    break;
  case 'google':
    var logoMain = document.querySelector('#lga');
    var logoSecondary = document.querySelector('#logo > img:nth-child(1)');
    if (isset(logoMain)) {
      // Replace the "O"s of google's main logo with trollfaces and write "Trollland" under it
      logoMain.innerHTML = '<div style="padding-top:156px"><style>@media (-moz-max-device-pixel-ratio:1),(max-resolution:96dpi){#hplogo{background: transparent url("data:image/png;base64,") no-repeat scroll 0% 0%; width: 272px; height: 92px;}}</style><div title="Google" id="hplogo" onload="window.lol&amp;&amp;lol()" align="left"><div class="logo-subtext">Trollland</div></div></div>';
    }
    if (isset(logoSecondary)) {
      // Replace the "O"s of google's search logo with trollfaces
      logoSecondary.src = 'data:image/png;base64,';
    }
    break;
  case 'netflix':
    logo = document.querySelectorAll('.svg-icon-netflix-logo') [0];
    if (isset(logo)) {
      // Replaces top left small icon's text "Netflix" with "Nettroll"
      logo.parentNode.innerHTML = '<a href="/de/" class="nfLogo signupBasicHeader" data-reactid=".mtwuzh9ukg.1.1"><img src="data:image/png;base64,"></img></a>'
    }
    break;
  case 'wikipedia':
    logo = document.querySelectorAll('.mw-wiki-logo') [0];
    if (isset(logo)) {
      // Replace the top left icon with a trollface and the text "Wikipedia" below it with "Trollipedia"
      logo.style.backgroundImage = 'url(\'data:image/png;base64,\')';
    }
    break;
}
function isset(element) {
  if (element !== null && element !== undefined) {
    return true;
  } else {
    return false;
  }
}
function addCSSRule(sheet, selector, rules, index) {
  if ('insertRule' in sheet) {
    sheet.insertRule(selector + '{' + rules + '}', index);
  } else if ('addRule' in sheet) {
    sheet.addRule(selector, rules, index);
  }
}